'use strict'
const compare = require('./compare')
const concat = require('./concat')
const equals = require('./equals')
const fromString = require('./from-string')
const toString = require('./to-string')
const xor = require('./xor')

module.exports = {
  compare,
  concat,
  equals,
  fromString,
  toString,
  xor
}
